const Pago = require('../models/pago');
const User = require('../models/users')
const fs = require('fs')
const easyinvoice = require('easyinvoice');
const dayjs = require('dayjs');



const PagosController = {
  verPagos: async (req, res) => {
    try {
        const users = await Pago.find();
        res.status(200).json(users);
    } catch (error) {
        res.status(500).json({ message: 'Error al obtener usuarios' });
    }
},
  // Función para insertar un nuevo pago
  insertarPago: async (req, res) => {
    console.log("hoal");
    try {
      const nuevoPago = new Pago({
        usuario: req.body.usuario,
        monto: req.body.monto,
        metodo_pago: req.body.metodo_pago
      });
      const pagoGuardado = await nuevoPago.save();

      res.status(201).json(pagoGuardado);
    } catch (error) {
      res.status(400).json({ message: error.message });
    }
  },

  // Función para aceptar un pago (actualizar su estado a 'completado')
  aceptarPago: async (req, res) => {
    try {
      const pagoAceptado = await Pago.findByIdAndUpdate(req.params.id, { estado_pago: 'completado' }, { new: true });
      if (!pagoAceptado) {
        return res.status(404).json({ message: 'No se encontró el pago para aceptar' });
      }
      id_usuario = pagoAceptado.usuario
      const usuario = await User.findById(id_usuario)
      let data = {

        "client": {
            "company": usuario.usuario,
            "address": "Venezuela",
            "zip": "4567 CD",
            "city": "XXX",
            "country": "Venezuela"
        },
      
        "sender": {
            "company": "BLENDS",
            "address": "Blends 123",
            "zip": "1234 AB",
            "city": "Caracas",
            "country": "Venezuela"
        },
        "images": {
            logo: "http://localhost:3000/public/logoblends.png",
            background: ""
      
        },
      
        "information": {
      
            "date": dayjs().format('DD-MM-YYYY'),
        },
      
        "products": [
            {
                "quantity": "1",
                "description": "Premium",
                "tax-rate": 0,
                "price": 86.87
            },
        ],
      
        "bottomNotice": "Ya puede disfrutar de sus caracteristicas premium.",
      
        "settings": {
            "currency": "USD"
        },
      };
      easyinvoice.createInvoice(data, function (result) {
        fs.writeFileSync("invoice.pdf", result.pdf, 'base64');
    });
      res.json(pagoAceptado);
    } catch (error) {
      res.status(500).json({ message: error.message });
    }
  },

  // Función para rechazar un pago (eliminarlo)
  rechazarPago: async (req, res) => {
    try {
      const pagoEliminado = await Pago.findByIdAndDelete(req.params.id);
      if (!pagoEliminado) {
        return res.status(404).json({ message: 'No se encontró el pago para eliminar' });
      }

      res.json({ message: 'Pago eliminado exitosamente' });
    } catch (error) {
      res.status(500).json({ message: error.message });
    }
  }
};

module.exports = PagosController;

